import styled from "styled-components";
import TopBar from "../component/TopBar";
import SideBar from "../component/SideBar";

const Background = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
`;

const Layout = () => {
    return (
        <Background>
            <TopBar/>
            <SideBar/>
        </Background>
    );
};

export default Layout;
